defaultpen(linewidth(0.7pt));

draw((0,0)--(20,0)--(20,20)--(0,20)--cycle);
draw(Circle((5,5),5));
draw(Circle((15,5),5));
draw(Circle((5,15),5));
draw(Circle((15,15),5));
[/asy]

A circle of radius 1 is surrounded by 4 circles of radius $r$ as shown. What is $r$?

[asy]
unitsize(0.6cm);
for(int i=0; i<2; ++i){
for(int j=0; j<2; ++j){
draw(Circle((-2.4+4.8i,-2.4+4.8j),2.4),linewidth(0.7));
draw((-2.4+4.8i,-2.4+4.8j)--(-0.7+4.8i,-0.7+4.8j));
label("$r$",(-1.5+4.8i,-1.5+4.8j),SE);
};
}
draw(Circle((0,0),1),linewidth(0.7));
draw((0,0)--(1,0));
label("1",(0.5,0),S);
[/asy]

In the diagram, $\triangle ABE$, $\triangle BCE$ and $\triangle CDE$ are right-angled, with $\angle AEB=\angle BEC = \angle CED = 60^\circ$, and $AE=24$. [asy]
