The surface area of a sphere with radius $r$ is $4\pi r^2$. Including the area of its circular base, what is the total surface area of a hemisphere with radius 6 cm? Express your answer in terms of $\pi$.

[asy]

import markers;
size(150);
import geometry;
draw((0,-7)--(0,-1),Arrow);
draw((10,10)--(5,5),Arrow);
label("half of sphere",(10,10),N);
label("circular base",(0,-7),S);

draw(scale(1,.2)*arc((0,0),10,0,180),dashed);
draw(scale(1,.2)*arc((0,0),10,180,360));
draw(Arc((0,0),10,0,180));

[/asy]

Three coplanar squares with sides of lengths two, four and six units, respectively, are arranged side-by-side, as shown so that one side of each square lies on line $AB$ and a segment connects the bottom left corner of the smallest square to the upper right corner of the largest square. What is the area of the shaded quadrilateral? [asy] size(150); defaultpen(linewidth(0.9)+fontsize(10));
fill((2,0)--(6,0)--(6,3)--(2,1)--cycle,gray(0.8));
draw(scale(2)*unitsquare);
draw(shift(2,0)*scale(4)*unitsquare);
draw(shift(6,0)*scale(6)*unitsquare);
draw((0,0)--(12,6));

real d = 1.2; pair d2 = (0.9,0);
pair A = (-d,0), B = (12+d,0); dot(A,linewidth(3)); dot(B,linewidth(3)); label("A",A,(0,-1.5)); label("B",B,(0,-1.5)); draw(A-d2--B+d2,Arrows(4));
label("2",(1,2.7)); label("4",(4,4.7)); label("6",(9,6.7));
[/asy]

A square and isosceles triangle of equal height are side-by-side, as shown, with both bases on the $x$-axis. The lower right vertex of the square and the lower left vertex of the triangle are at $(10, 0)$. The side of the square and the base of the triangle on the $x$-axis each equal $10$ units. A segment is drawn from the top left vertex of the square to the farthest vertex of the triangle, as shown. What is the area of the shaded region?  [asy]
/* note: original diagram not to scale, equilateral triangle same height as rectangle */
import graph; size(140); real lsf=0.5; pen dps=linewidth(0.85)+fontsize(10); defaultpen(dps); pen ds=black; real xmin=-2.2,xmax=23.1,ymin=-2.2,ymax=12.87;

pen zzttqq=dps;
draw((0,0)--(10,0)--(10,10)--(0,10)--cycle,zzttqq); draw((10,0)--(20,0)--(15,10)--cycle,zzttqq);

Label laxis; laxis.p=fontsize(10); string blank(real x){return "";}

xaxis("$x$",xmin,xmax,defaultpen+black,Arrows(4),above=true); yaxis("$y$",ymin,ymax,defaultpen+black,Arrows(4),above=true); draw((0,0)--(10,0),zzttqq); draw((10,0)--(10,10),zzttqq); draw((10,10)--(0,10),zzttqq); draw((0,10)--(0,0),zzttqq); draw((10,0)--(20,0),zzttqq); draw((0,10)--(20,0)); filldraw((10,0)--(20,0)--intersectionpoints((0,10)--(20,0),(15,10)--(10,0))[0]--cycle,gray(0.7));
dot((10,0),ds); label("$(10,\,0)$",(10,0),S);
clip((xmin,ymin)--(xmin,ymax)--(xmax,ymax)--(xmax,ymin)--cycle);

[/asy]

Sector $OAB$ is a quarter of a circle of radius 3 cm. A circle is drawn inside this sector, tangent at three points as shown. What is the number of centimeters in the radius of the inscribed circle? Express your answer in simplest radical form. [asy]
import olympiad; import geometry; size(100); defaultpen(linewidth(0.8));
draw(Arc(origin,3,90,180));
draw((-3,0)--(origin)--(0,3));
real x = 3/(1 + sqrt(2));
draw(Circle((-x,x),x)); label("$B$",(0,3),N); label("$A$",(-3,0),W);
label("$O$",(0,0),SE); label("3 cm",(0,0)--(-3,0),S);
[/asy]

In triangle $ABC$, angle $ACB$ is 50 degrees, and angle $CBA$ is 70 degrees.  Let $D$ be the foot of the perpendicular from $A$ to $BC$, $O$ the center of the circle circumscribed about triangle $ABC$, and $E$ the other end of the diameter which goes through $A$.  Find the angle $DAE$, in degrees.

[asy]

unitsize(1.5 cm);

pair A, B, C, D, E, O;

A = dir(90);

B = dir(90 + 100);

C = dir(90 - 140);

D = (A + reflect(B,C)*(A))/2;

E = -A;

O = (0,0);

draw(Circle(O,1));

draw(A--B--C--cycle);

draw(A--D);

draw(A--E,dashed);

label("$A$", A, N);

label("$B$", B, W);

label("$C$", C, SE);

label("$D$", D, SW);

label("$E$", E, S);

dot("$O$", O, dir(0));

[/asy]

Triangle $ABC$ is an obtuse, isosceles triangle. Angle $A$ measures 20 degrees. What is number of degrees in the measure of the largest interior angle of triangle $ABC$?

[asy]
draw((-20,0)--(0,8)--(20,0)--cycle);
label("$20^{\circ}$",(-13,-0.7),NE);
label("$A$",(-20,0),W);
label("$B$",(0,8),N);
label("$C$",(20,0),E);

[/asy]

Five points $A$, $B$, $C$, $D$, and $O$ lie on a flat field.  $A$ is directly north of $O$, $B$ is directly west of $O$, $C$ is directly south of $O$, and $D$ is directly east of $O$. The  distance between $C$ and $D$ is 140 m.  A hot-air balloon is positioned in the air at $H$ directly above $O$. The balloon is held in place by four ropes $HA$, $HB$, $HC$, and $HD$.  Rope $HC$ has length 150 m and rope $HD$ has length 130 m. How high is the balloon above the field (that is, the length of $OH$)? [asy]
size(200);
pair A, B, C, D, O, H, W, X, Y, Z;
O=(0,0);
A=(1,1);
D=(1.5,-.3);
B=(-1.5,.3);
C=(-1,-1);
H=(0,2.5);
W=(5/3)*(A+D);
X=(5/3)*(A+B);
Y=(-1)*(W);
Z=(-1)*(X);
draw(W--X--Y--Z--W);
draw(A--C);
draw(B--D);
draw(O--H, linewidth(1));
draw(A--H, dashed);
draw(B--H, dashed);
draw(C--H, dashed);
draw(D--H, dashed);
dot(A);
dot(B);
dot(C);
dot(D);
dot(O);
dot(H);
label("A", A, NE);
label("B", B, SW);
label("C", C, SE);
label("D", D, NE);
label("O", O, SE);
label("H", H, NW);
[/asy]

The field shown has been planted uniformly with wheat. [asy]
draw((0,0)--(1/2,sqrt(3)/2)--(3/2,sqrt(3)/2)--(2,0)--(0,0),linewidth(0.8));
label("$60^\circ$",(0.06,0.1),E);
