label("100 m",(1.75,sqrt(3)/4+0.1),E);
[/asy] At harvest, the wheat at any point in the field is brought to the nearest point on the field's perimeter. What is the fraction of the crop that is brought to the longest side?

In a circle with center $O$, $AD$ is a diameter, $ABC$ is a chord, $BO = 5$, and $\angle ABO = \text{arc } CD = 60^\circ$.  Find the length of $BC$.

[asy]
import graph;

unitsize(2 cm);

pair O, A, B, C, D;

O = (0,0);
A = dir(30);
C = dir(160);
B = (2*C + A)/3;
D = -A;

draw(Circle(O,1));
draw(C--A--D);
draw(B--O);

label("$A$", A, NE);
label("$B$", B, N);
label("$C$", C, W);
label("$D$", D, SW);
label("$O$", O, SE);
[/asy]

A square is inscribed in a circle.  A smaller square has one side coinciding with a side of the larger square and has two vertices on the circle, as shown.  What percent of the area of the larger square is the area of the smaller square?

